                    alert(obj.body)

}
    
    return(
        <div>
            <div>
                <h5 id="AddHead">Add header</h5>
                <p>{prop.title}</p>
                <p>{prop.details}</p>
        
                
             </div>
             <button onClick={AddCart}>Add to cart</button>
        </div>
    )
}

